package maximumnumberofvowelsinasubstringofgivenlength

import (
	"testing"
)

func TestMaxVowels(t *testing.T) {
	type test struct {
		name     string
		input    string
		k        int
		expected int
	}
	tests := []test{
		{
			name:     "test 1",
			input:    "abciiidef",
			k:        3,
			expected: 3,
		},
		{
			name:     "test 2",
			input:    "aeiou",
			k:        2,
			expected: 2,
		},
		{
			name:     "test 3",
			input:    "leetcode",
			k:        3,
			expected: 2,
		},
		{
			name:     "test 4",
			input:    "weallloveyou",
			k:        7,
			expected: 4,
		},
		{
			name:     "test 5",
			input:    "",
			k:        3945,
			expected: 4,
		},
		{
			name:     "test 6",
			input:    "zpuerktejfp",
			k:        3,
			expected: 2,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			actual := maxVowels(tt.input, tt.k)
			if actual != tt.expected {
				t.Errorf("Actual: %d; Expected: %d", actual, tt.expected)
			}
		})
	}
}
